description:
Cocktail waitress and single mother Samantha Rogers will do whatever it takes to provide for her daughter. And her one chance at security comes when down-and-out fight promoter Sonny Cool introduces Sam to the dangerous and illegal world of high-stakes all-female bare knuckle fighting. Shell face the fight of her life when she climbs into the ring where there is no room for weakness and no mercy for the loser. Inspired by a true story.
